import React, { useEffect, useState } from "react";

function App() {
  const [msg, setMsg] = useState("");

  useEffect(() => {
    fetch("http://localhost:8080/ServletWebProject/helo")
      .then((res) => {
        if (!res.ok) throw new Error("Server error!");
        return res.json(); // <-- yahan pe contentType zaroori hai
      })
      .then((data) => setMsg(data.msg))
      .catch((err) => setMsg("Error: " + err.message));
  }, []);

  return (
    <div>
      <h1>React + Servlet Demo</h1>
      <p>Message from Servlet: {msg}</p>
    </div>
  );
}

export default App;
